//https://leetcode.com/problems/remove-all-adjacent-duplicates-in-string-ii
class Solution {
public:
    bool flag;
    string removeDuplicates(string s, int k) {
        flag = false;
        stack<pair<char, int>> _stck;
        for(auto ch: s){
            if(_stck.empty() || (_stck.top().first != ch)){
                _stck.push({ch, 1});
            }else{
                _stck.top().second++;
                if(_stck.top().second == k){
                    _stck.pop();
                    flag = true;
                }
            }
        }
        s = "";
        while(!_stck.empty()){
            auto [ch, count] = _stck.top();
            while(count--){
                s.insert(0, 1, ch);
            }
            _stck.pop();
        }
        if(flag){
            return removeDuplicates(s, k);
        }
        return s;
    }
};
